import '../styles/Table.css';

class ControlPanel extends React.Component{
 render(){
     return(
         <div className="conten-panel">
             <div className="conten-panel-barra"></div>
             <div className="conten-panel-table"></div>
         </div>
     );
 }
}

export default ControlPanel
